import React, { useState } from "react";
import RegisterPage from "./components/RegisterPage";
import RentPage from "./components/RentPage";
import ParttimeJob from "./components/ParttimeJob";
import JobResults from "./components/JobResults";
import LandingPage from "./components/LandingPage";

function App() {
  const [page, setPage] = useState("register");
  const [user, setUser] = useState(null);

  const handleRegister = (data) => {
    console.log("User Registered:", data);
    setUser(data);
    setPage("rent");
  };

  return (
    <>
      {page === "register" && <RegisterPage onRegister={handleRegister} />}
      {page === "rent" && <RentPage onNext={() => setPage("parttime")} />}
      {page === "parttime" && <ParttimeJob onNext={() => setPage("results")} />}
      {page === "results" && <JobResults onNext={() => setPage("landing")} />}
      {page === "landing" && <LandingPage />}
    </>
  );
}

export default App;
